import styled from "styled-components";
import { Icon } from "../../../../components/icon/Icon";

type ProjecType = {
	src: string;
	alt: string;
	title: string;
	text: string;
	link: string;
};

export function Project(props: ProjecType) {
	return (
		<StyledProject>
			<Image src={props.src} alt={props.alt} />
			<Title>{props.title}</Title>
			<Text>{props.text}</Text>
			<span>
				<Link href={props.link}>View More<Icon iconId="chewron" /></Link>

			</span>
		</StyledProject>
	);
}

const StyledProject = styled.div`
	background-color: #70555b;
	max-width: 350px;
	width: 100%;
`;

const Image = styled.img`
	width: 100%;
	height: 260px;
	object-fit: cover;
`;

const Title = styled.h3``;

const Text = styled.p``;

const Link = styled.a``;
